const Navbar = () => {
    return (
        <nav className="navbar">
            <a className="logo" href="/">
                <h1>L'avantage de la glace</h1>
            </a>
            <div className="links">
                <a href="/patinage">Patinage</a>
                <a href="/lancers">Lancers</a>
                <a href="/maniement">Maniement</a>
                <a href="/strategies">Stratégies</a>
                <a href="/hors-glace">Hors-Glace</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
